import { createWebHistory, createRouter } from "vue-router";
const routes = [
  {
    name: "Register",
    component: () => import("../components/Register.vue"),
    path: "/",
  },
  {
    name: "Login",
    component: () => import("../components/Login.vue"),
    path: "/login",
  },
  {
    name: "ForgetPassword",
    component:()=> import("../")
  },
];

const router = createRouter({
  history: createWebHistory(),
  routes,
});

export default router;
